void printArray(uint32_t* a, uint32_t size){
	for(int i = size-1; i >= 0; i--){
		printf("%08x ", a[i]);
	}
	printf("\n\r");
}

void check(uint32_t* res, uint32_t* expected_res, int size){
    for(int i = 0; i < size; i++){
        for(int j = 0; j < size; j++){
            if(((expected_res[i] >> j) & 1) != ((res[i] >> j) & 1)){
            	//printf("ERROR\n\r");
            	printf("Values differs at i=%d j=%d\n\r", i, j);
            	//printf("exp:%08lx\n\r", expected_res[i]);
            	//printf("got:%08lx\n\r", res[i]);
                return;
            }
        }
    }
    printf("Succes the two inputs are the same\n\r");
    //return 0;
}


